import React from 'react'

export default function Waiting() {
    return (
        <div style={{
            height: "100vh",
            display: "flex",
            alignItems: "center",
            alignContent: "center",
            justifyContent: "center",
            background: "radial-gradient(circle, #2c5365, #1b2735)",
        }}>
            <h1 style={{
                color: "white",
                fontSize: "50px",
                margin: "0px",
                alignSelf: "center",
                position: "absolute",
                top: 50,
                left: 50,

                translate: "translate(-50%, -50%)",
                fontWeight: "bold",
            }}>Waiting for redirect...</h1>
        </div>
    )
}
